import React from "react";
import {
  StyledContainer,
  PageTitle,
  PageLogo,
  InnerContainer,
  SubTilte,
  StyledFormArea,
  StyledTextInput,
  ButtonText,
  StyledButton,
  RightIcon,
  LeftIcon,
  StyledInputLabel

} from "./../Components/Styles";
import { StatusBar } from "expo-status-bar";
import { Formik } from "formik";

const Login = () => {
  return (
    <>
      <StyledContainer>
        <StatusBar></StatusBar>
        <InnerContainer>
          <center>
            <PageLogo
              source={require("../../asset/chat.jpg")}
              alt="Studethandelr"
            />
          </center>
          <PageTitle>Students</PageTitle>
          <SubTilte>Account Login </SubTilte>
          <Formik
            intialValues={{ email: " ", password: " " }}
            onSubmit={(values) => {
              console.log(values);
            }}
          >
            {({ handleChange, handleBlur, handleSubmit, values }) => (
              <StyledFormArea>
                
                <MyTextInput
                label="Email Address"
                icon="mail"
                placeholder="email.com"
                placeholderTextColor="blacl"
                onChangeText={handleChange('email')}
                onBlur={handleBlur('email')}
                value={values.email}
                keybordType="email.address"
                >

                </MyTextInput>
              </StyledFormArea>
            )}
          </Formik>
        </InnerContainer>
      </StyledContainer>
    </>
  );
};

import { View } from "react-native";
import {Octicons} from '@expo/vector-icons';
const MyTextInput = ({ label, icon, props }) => {
  return (<View>
    <LeftIcon>
      <Octicons name={icon} size={30}  color={black} />
    </LeftIcon>
    <StyledInputLabel>
      {label}
    </StyledInputLabel>
    <StyledTextInput>{props}</StyledTextInput>
  </View>);
};
export default Login;
